long_desc.thetext:
So, glibc calls glibc_post_upgrade in post. In that it has:
/* Check if telinit is available and either SysVInit fifo, or upstart telinit. */ if (access ("/sbin/telinit", X_OK) || ((!!access ("/dev/initctl", F_OK)) ^ !access ("/sbin/initctl", X_OK))) _exit (0);
/* Check if we are not inside of some chroot, because we'd just timeout and leave /etc/initrunlvl.
On more modern systems this test is not sufficient to detect if we're in a chroot. */ if (readlink ("/proc/1/exe", initpath, 256) <= 0 || readlink ("/proc/1/root", initpath, 256) <= 0) _exit (0);
/* Here's another well known way to detect chroot, at least on an ext and xfs filesystems and assuming nothing mounted on the chroot's root. */ if (stat ("/", &statbuf) != 0 || (statbuf.st_ino != 2 && statbuf.st_ino != 128)) _exit (0);
if (check_elf ("/proc/1/exe")) verbose_exec (116, "/sbin/telinit", "/sbin/telinit", "u");
The 'telinit' man page says:
" u, U Serialize state, reexecute daemon and deserialize state again. This is equivalent to systemctl daemon-reexec."
But this doesn't seem to be the case. Manually running:
sudo /sbin/telinit u
here causes this exact bug.
Doing:
sudo /sbin/systemctl daemon-reexec
doesn't.
So, there's some systemd behavior change here. Either it needs to fix 'telinit u' or glibc needs to change to call 'systemctl daemon-reexec' or something.
